import React, {Component, Fragment} from "react";
import {
    Card,
    CardHeader,
    CardBody,
    CardFooter,
    CardTitle,
    Row,
    Col
} from "reactstrap";
import Button from "./Button";
import {FaWhatsapp} from "react-icons/fa";

class Twitter extends React.Component {
    render() {
        return (
            <div className="content">
                <Button icon={<FaWhatsapp/>} url={'https://web.whatsapp.com/'} color={'success'} title={'WhatsApp'}/>
                <Button icon={<FaWhatsapp/>} url={'https://web.whatsapp.com/'} color={'primary'} title={'Facebook'}/>
            </div>
        );
    }
}

export default Twitter;
